window.bookSummaryJSON = "<p>When Cooper McKay moved in next door to her, all bronzed skin and lean muscle, with a panty dropping smile that could bring any girl to her knees, Kayla Keller knew she had met the man of her dreams. He set her body and teenage hormones on fire for three years - three long tortuous years. </p> <p>She pushed. He retreated. It became a game of tug of war, until one fateful night she put her well thought out plan into motion, and Officer Sexy didn't know what hit him. </p> <p>You asked for their story, and now here it is. Cooper and Kayla are not only going to share their special day with you, they are going to take you back to where it all began. Here is their crazy love story, from beginning to...forever.</p> <p><i>Contains mature themes.</i></p>"; 
